import Logo from "./logo.png";
import Account from "./account_circle.png";

export const Header = () => {
  return (
    <header className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
      <div>
        <img src={Logo} alt="Logo" />
      </div>
      <nav>
        <ul className="flex space-x-4">
          <li>Главная</li>
          <li>О нас</li>
          <li>Помощь</li>
          <li>+7 495 967 13 01</li>
        </ul>
      </nav>
      <div className="flex items-center">
        <div>Личный кабинет</div>
        <img src={Account} alt="Account" className="ml-2" />
      </div>
    </header>
  );
};
